  false,\n\t\"url\": null,\n\t\"notes\": \"A crude oil spill estimated at 60 u2013
  10,000 gallons was discovered at the Alyeska Trans Alaska Pipeline on the north
  side of Atigun Pass in the Brooks Range on June 10, 1979. Biologists from the Alaska
  Department of Fish and Game, Alaska Department of Environmental Conservation, U.S.
  Bureau of Land Management, and U.S. Fish and Wildlife Service observed the spill
  area between June 10 and June 28, 1979. Their observations are summarized in this
  report.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
